import React from "react";
import footer_logo from "../../assets/img/logo_white.png";
import "./footer.css";

const Footer = () => {
  return (
    <div className="wrap_footer">
      <div className="footer">
        <div className="footer_cta-content">
          <div className="footer_cta-block_logo">
            <img src={footer_logo} alt="Logo Image" />
          </div>
          <h1>Want to recieve our awesome stories?</h1>
          <div className="footer_cta-content__input">
            <input
              type="email"
              placeholder="Enter your email"
              id="email_footer"
            />
            <button className="button">Subscribe</button>
          </div>
        </div>
        <div className="footer_links">
          <div className="footer_web-application-links"></div>
          <div className="footer_social-media_links"></div>
        </div>
      </div>
    </div>
  );
};

export default Footer;
